import { FreeMode ,Pagination} from "swiper";
import "swiper/css";
import "swiper/css/free-mode";
import { Swiper, SwiperSlide } from 'swiper/react';

export default function App() {
  return (
    <>
      <Swiper
        slidesPerView={5}
        spaceBetween={30}
        pagination={{
          clickable: true,
        }}
        modules={[Pagination]}
        className="mySwiper"
      >
        <SwiperSlide>
            <img src="https://www.seekpng.com/png/detail/257-2573844_com-wedding-services-reviews-reviews-wedding-wire-badge.png" width={189}></img>
        </SwiperSlide>
        <SwiperSlide><img src="https://qph.cf2.quoracdn.net/main-qimg-2b92061a6b65e7a95eedb739c92dd362" width={189}>
        </img></SwiperSlide>
        <SwiperSlide>
            <img src="https://techcrunch.com/wp-content/uploads/2012/06/eventbrite-logo.gif" width={189}></img>
        </SwiperSlide>
        <SwiperSlide>
            <img src="https://banner2.cleanpng.com/20180708/lwc/kisspng-the-jewellery-channel-gemological-institute-of-ame-jewelry-store-logo-5b42a2663678e5.6630260315310936062231.jpg">
        </img></SwiperSlide>
        <SwiperSlide>Slide 5</SwiperSlide>
        <SwiperSlide>Slide 6</SwiperSlide>
        <SwiperSlide>Slide 7</SwiperSlide>
        <SwiperSlide>Slide 8</SwiperSlide>
        <SwiperSlide>Slide 9</SwiperSlide>
      </Swiper>
    </>
  );
}
